import React from 'react'
import '../App.css';
import { Navigate } from 'react-router-dom';

const Landing = () => {

    if(localStorage.token)
    {
        return(
          <div className='container-frame' >

                <div class="embed-responsive embed-responsive-21by9">
                    <iframe class="embed-responsive-item" title='ElevenHealth' src="https://sense-demo.qlik.com/sso/single/?appid=cd840389-f841-4477-86be-532fb0b13775&sheet=aLvPhq&opt=ctxmenu,currsel" allowFullScreen></iframe>
                </div>
            </div>
        );
    }
    else {
        return <Navigate to="/" />;
    }
}

export default Landing;
